// The Page1 component is a functional component that displays a list of Samsung models. 
// Each Samsung model is displayed as an image with its name and price. 
// When an image is clicked, the handleSelectItem function is called to toggle the selection of the item. 
// The selected items are stored in the selectedItems state using the useState hook. 
// The handleNext function is called when the "Total Selected Phones" button is clicked, which navigates the user to the /page3 route using the useNavigate hook.
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { useDispatch } from 'react-redux';
import { addItem } from './selectedItemsSlice';
const Page2 = () => {
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const [selectedItems, setSelectedItems] = useState([]);
  const handleSelectItem = (item) => {
    setSelectedItems((prevItems) =>
      prevItems.includes(item) ? prevItems.filter(i => i !== item) : [...prevItems, item]
    );
    dispatch(addItem(item));
  };
  const handleNext = () => {
    navigate('/page3');
  };
  const handlePrevious = () => {
    navigate('/page1');
  };
  return (
    <div style={styles.pageContainer}>
      <h1 style={styles.pageTitle}>Page 2</h1>
      <h2 style={styles.subtitle}>Select Your Samsung Phone</h2>
      <div style={styles.imagesContainer}>
        {[
          { name: 'Samsung Galaxy S21', price: '$499', img: 'data:image/jpeg;base64,' },
          { name: 'Samsung Galaxy S22', price: '$699', img: 'data:image/jpeg;base64,' },
          { name: 'Samsung Galaxy S23 Ultra', price: '$999', img: 'data:image/jpeg;base64,' },
          { name: 'Samsung Galaxy S24 Ultra', price: '$1199', img: 'data:image/jpeg;base64,' },
        ].map((phone) => (
          <div key={phone.name} style={styles.itemContainer} onClick={() => handleSelectItem(phone.name)}>
            <img 
              src={phone.img} 
              alt={phone.name} 
              style={selectedItems.includes(phone.name) ? styles.selectedImage : styles.image} 
            />
            <p style={styles.itemText}>{phone.name} - {phone.price}</p>
          </div>
        ))}
      </div>
      <div>
        <button style={styles.backButton} onClick={handlePrevious}>
         Go to Iphone Page
        </button>
        <button style={styles.nextButton} onClick={handleNext}>
          Total Selected Phones
        </button>
      </div>
    </div>
  );
};
const styles = {
  pageContainer: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    height: '100vh',
    backgroundColor: '#f7f7f7',
    textAlign: 'center',
  },
  pageTitle: { 
    fontSize: '2.5rem',
    fontWeight: '700',
    marginBottom: '20px',
    color: '#333'
    },
  subtitle: {
    fontSize: '1.5rem',
    fontWeight: '600',
    color: '#555',
    marginBottom: '20px' 
    },
  imagesContainer: { 
    display: 'flex',
    gap: '20px',
    flexWrap: 'wrap',
    justifyContent: 'center',
    marginBottom: '30px'
    },
  itemContainer: {
    textAlign: 'center',
    cursor: 'pointer' 
    },
  image: { 
    width: '200px',
    height: '200px',
    borderRadius: '8px',
    transition: '0.3s ease'
   },
  selectedImage: { 
    width: '150px',
    height: '150px',
    borderRadius: '8px',
    transform: 'scale(1.1)',
    opacity: '0.7',
    transition: '0.3s ease'
   },
  itemText: { 
    fontSize: '1rem',
    fontWeight: '500',
    marginTop: '10px' 
   },
  nextButton: { 
    padding: '12px 24px',
    fontSize: '1rem',
    backgroundColor: '#2196f3',
    color: 'white',
    border: 'none',
    borderRadius: '8px',
    cursor: 'pointer',
    marginLeft: '10px',
    transition: '0.3s ease' 
  },
  backButton: { 
    padding: '12px 24px',
    fontSize: '1rem',
    backgroundColor: '#f44336',
    color: 'white',
    border: 'none',
    borderRadius: '8px',
    cursor: 'pointer',
    transition: '0.3s ease'
   },
};
export default Page2;

